import random

def generate_solution():
    return random.randint(1, 10)

def game():
    solution = generate_solution()
    guess = -1

    while guess != solution:
        guess = int(input("Guess a number between 1 and 10: "))

        if guess == solution:
            print("You win!")
        else:
            print("Try again!")

game()

