from flask import Flask, request
import pickle

app = Flask(__name__)

games = {}
history = {}

@app.route("/games", methods=["POST"])
def create_game():
    game_id = len(games) + 1
    serialized = request.data
    game = pickle.loads(serialized)

    games[game_id] = game
    history[game_id] = []

    return {"id": game_id}

@app.route("/games/<int:game_id>/move/<direction>", methods=["POST"])
def move(game_id, direction):
    game = games[game_id]

    if direction == "up":
        game.move_up()
        history[game_id].append("up")
    elif direction == "down":
        game.move_down()
        history[game_id].append("down")
    elif direction == "left":
        game.move_left()
        history[game_id].append("left")
    elif direction == "right":
        game.move_right()
        history[game_id].append("right")
    else:
        return "Invalid direction", 400

    return "Moved", 200

if __name__ == "__main__":
    app.run()
